import MUIDataTable from 'mui-datatables'

const columns = [
	{
		name: 'sender',
		label: 'Sender',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'receiver',
		label: 'Receiver',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'transId',
		label: 'Transaction ID',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'reqDate',
		label: 'Request Date',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'amount',
		label: 'Amount',
		options: {
			sort: true
		}
	}
]

const options = {
	download: false,
	print: false
}
const UserRFM = ({ data }) => {
	return (
		<div>
			<ul>
				{Object.keys(data).map((d) => (
					<li>
						{d}: {data[d]}
					</li>
				))}
			</ul>
		</div>
	)
}

export default UserRFM
